.DESCRIPTION

The IPRange structure is used to express a range of IP addresses. The IP address supported by this structure will depend on the IP version that is being used by Supervisor.   Currently, the Supervisor only supports IPv4.

.PARAMETER Address
IPRange.address is the starting IP address of the IPRange.
.PARAMETER Count
IPRange.count is number of IP addresses in the range.   For example:   A /24 subnet will have a count of 256.   A /24 subnet with a gateway address and a broadcast address will have a count of 254.
.OUTPUTS

NamespaceManagementNetworksIPRange<PSCustomObject>

.LINK

Online Version: https://developer.vmware.com/docs/vsphere-automation/latest/vcenter/data-structures/NamespaceManagement/Networks/IPRange/
#>

