        [Parameter(Mandatory = $true)]
        [ValidateScript({ $_ -is [string] })]
        ${Address},
        [Parameter(Mandatory = $true)]
        [Int64]
        ${Count}
    )

    Process {
        'Creating PSCustomObject: VMware.Sdk.vSphere.vCenter.NamespaceManagement => vSphereNamespaceManagementNetworksIPRange' | Write-Debug

        if ($Count -eq $null) {
            throw "invalid value for 'Count', 'Count' cannot be null."
